import React from 'react'
import Banner from "Componentes/banner";
import styles from "./inicio.module.css"

import posts from 'json/posts.json'
function Inicio() {
    return (
        <div>
            <Banner />
            <ul className={styles.posts}>
                {posts.map((post) => (
                    <li key={post.id} >
                        <Post post={post} />
                    </li>
                ))}
            </ul>
        </div>
    )
}   


export default Inicio
